import React from 'react';
export const DragComponent = ({ data, sortData, letMeKnow }) => {
    return (<div className="item-container">
        {data.map((d, idx) =>
            <div id={`item${idx}`} className="items" key={`item${idx}`} ondrag={letMeKnow}>
                {d.description}
            </div>
        )}
    </div>)
}
